import React, { Component } from 'react'

export class ListItemCard extends Component {
    render() {
        return (
            <div className='list_item_card' onClick={this.props.goItem}
            id={'list_item_card_'+this.props.key}>
                <div className='list_item_card_description'>
                    {this.props.listItem.description}
                </div>
                <div className='list_item_card_assigned_to'>
                    Assigned To: <strong>{this.props.listItem.assigned_to}</strong>
                </div>
                <div className='list_item_card_due_date'>
                    {this.props.listItem.due_date}
                </div>
                <div className='list_item_card_completed'>
                {(() => {
                    switch (this.props.listItem.completed) {
                    case true:   return "Completed";
                    case false: return "";
                    default:      return "Error";
                    }
                })()}
                </div>
                <div className='list_item_card_not_completed'>
                {(() => {
                    switch (this.props.listItem.completed) {
                    case true:   return "";
                    case false: return "Pending";
                    default:      return "Error";
                    }
                })()}
                </div>
                {(() => {
                    let items = document.getElementsByClassName('list_item_card');
                    console.log(items);
                    for(var i = 0; i < items.length; i++){
                        console.log('running');
                        let listItem = items.item(i);
                        listItem.setAttribute('id', 'list_item_card_'+listItem.key);

                    }


                })()}
            </div>
        )
    }
}

export default ListItemCard
